  const { elementType } = props;

  switch (elementType) {
    case 'search':
      inputElement = (
        <input type="text" value={props.value} change={(event) => props.change(event)} placeholder="Search for teachers, courses" className="search" />
      )
      break;
    default:
      elementType = null
  }

  return (
    <Aux>
      {inputElement}
    </Aux>



  )
}

